import './App.css';
import ExperimentForm from './ExperimentForm';

function App() {
    const formIds = ['TBoEzUm6', 'UvkhDr93', 'RO3sqaqP'];

    return (
        <div className='App'>
            <div>{formIds.random().toString()}</div>
        </div>
    );
}

export default App;

Array.prototype.random = function () {
    return this[Math.floor(Math.random() * this.length)];
};
